import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import { makeStyles } from '@material-ui/core';
import NotificationsIcon from '@material-ui/icons/Notifications';


const styles = {
  root: {
    flexGrow: 1,
  },
  grow: {
    flexGrow: 1,
  },
  IconButton: {
    marginLeft: -12,
    marginRight: 20,
  },
};

const useStyles = makeStyles(theme => ({
  customHoverFocus: {
    color: 'white',
    "&:hover, &.Mui-focusVisible": { backgroundColor: "lightblue" }
  }
}));

function NavBar(props) {
  const classes = useStyles();
    return (
      <div className={classes.root}>
        <AppBar position="static" color='transparent' elevation={2}>
          <Toolbar>
            <IconButton className={classes.customHoverFocus} aria-label="Menu" aria-controls="customized-menu" size="medium" style={{ marginLeft: 'auto', float: '' }}>
                <NotificationsIcon />
            </IconButton>
            <IconButton className={classes.customHoverFocus} aria-label="Menu" aria-controls="customized-menu" size="medium" style={{ marginLeft: 'auto' }}>
              <MenuIcon fontSize="large"></MenuIcon>  
            </IconButton>
          </Toolbar>
        </AppBar>
      </div>
  );
}

NavBar.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(NavBar);
